(window.webpackJsonp=window.webpackJsonp||[]).push([[2241],{2596:function(n,h,t){"use strict";t.r(h);var g=t(44),c=Object(g.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-940-vo-đich-trinh-duong-ha"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-940-vo-đich-trinh-duong-ha"}},[n._v("#")]),n._v(" Chương 940: Vô địch Trịnh Dương (hạ)")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("Chương 940: Vô địch Trịnh Dương (hạ) "),t("br"),t("br"),n._v("“Ngươi nói cái gì?”"),t("br"),t("br"),n._v("Nghe nói như thế, Trác Thanh Phong sau lưng mấy vị Chiến sư, lập tức giận dữ."),t("br"),t("br"),n._v("Ngay cả Ô Thiên Khung, Thẩm Bình Triều đám người, cũng đầy mặt ngớ ra."),t("br"),t("br"),n._v("Cường đại như thế Chiến sư, bị người ở trước mặt đánh xiêu xiêu vẹo vẹo, còn chế giễu gà đất chó sành... Coi như tận mắt nhìn thấy, đều cảm thấy cùng giống như nằm mơ."),t("br"),t("br"),n._v("“Còn tưởng rằng cái gọi là Chiến sư bao nhiêu lợi hại, thoạt nhìn cũng không gì hơn cái này!”"),t("br"),t("br"),n._v("Một cái tay nắm chặt trường thương, một cái tay vác tại sau lưng, Trịnh Dương vẻ mặt thản nhiên."),t("br"),t("br"),n._v("Đã sớm nghe nói qua Chiến sư cái nghề nghiệp này, vốn cho rằng bao nhiêu lợi hại, chân chính nhìn thấy, thực sự có chút thất vọng."),t("br"),t("br"),n._v("“Khẩu khí thật lớn!”"),t("br"),t("br"),n._v("Thấy cái này không biết từ đâu xuất hiện gia hỏa, như vậy không che đậy miệng, cuồng vọng ngỗ ngược, Ngô Hư hét lớn một tiếng, tiến về phía trước một bước, đi ra: “Có thể dám cùng ta tỷ thí một trận?”"),t("br"),t("br"),n._v("Lúc này Ngô Hư, đã đạt đến Bán Thánh cấp bậc, mặc dù chỉ là sơ kỳ, tu vi nhưng cũng hùng hậu như sông, bình thường Bán Thánh đỉnh phong, đều khó mà chống lại."),t("br"),t("br"),n._v("“Có gì không dám?” Mí mắt vừa nhấc, Trịnh Dương trường thương khều lên, tựa như đang sống."),t("br"),t("br"),n._v("“Tốt, ta hiện tại liền đè thấp tu vi, cùng ngươi tỷ thí!”"),t("br"),t("br"),n._v("Ngô Hư gật đầu, lấy ra trường kiếm, kiếm mang bập bềnh, như là linh xà."),t("br"),t("br"),n._v("Hơn ba tháng thời gian, hắn không chỉ tu vi tăng lên, đối với kiếm pháp lĩnh ngộ cùng lý giải, cũng sâu hơn không ít, so với ban đầu ở Xích Huỳnh quả sơn cốc, càng thêm cường đại."),t("br"),t("br"),n._v("“Không cần, một cái Bán Thánh sơ kỳ mà thôi... Nhìn ta một thương phá đi!”"),t("br"),t("br"),n._v("Cười nhạt một tiếng, Trịnh Dương hướng về phía trước bước ra, dưới chân mặt đất giống như là rút ngắn một nửa, một bước liền đến đến Ngô Hư trước mặt, trường thương như rồng, mang theo huy hoàng khí tức, đối diện đánh tới."),t("br"),t("br"),n._v("“Tự tìm cái chết!”"),t("br"),t("br"),n._v("Thấy đối phương chiêu này không có chút nào sức tưởng tượng, thế mà cùng hắn cứng đối cứng, Ngô Hư vẻ mặt trầm thấp."),t("br"),t("br"),n._v("Bất kể nói thế nào, hắn đều là Bán Thánh cấp bậc Chiến sư, cùng cấp bậc có thể nói vô địch... Thực lực thấp, giống như những người khác, mưu lợi thắng ta cũng khó khăn, cứng đối cứng, không là muốn chết ư?"),t("br"),t("br"),n._v("Một tiếng quát nhẹ, Ngô Hư trường kiếm trong tay, không có bất kỳ cái gì sức tưởng tượng, trực tiếp hướng đối phương mũi thương đâm tới."),t("br"),t("br"),n._v("Cùng thời khắc đó, chân khí trong cơ thể như sông lớn vỡ đê, trào lên mà tới."),t("br"),t("br"),n._v("Đã đối phương cùng hắn cứng đối cứng, vậy hắn liền dùng Chiến sư lực lượng cường đại, để hắn rõ ràng, cử động như vậy là buồn cười biết bao."),t("br"),t("br"),n._v("Bành!"),t("br"),t("br"),n._v("Trường kiếm cùng trường thương đối đầu cùng một chỗ."),t("br"),t("br"),n._v(" Ngô Hư đang nghĩ ngợi, đối phương tất nhiên không chịu nổi hắn hùng hậu chân khí, bị tại chỗ nghiền ép, lập tức cảm thấy một cỗ càng thêm lực lượng hùng hồn, lan tràn mà tới."),t("br"),t("br"),n._v("Chân khí trong cơ thể hắn sông lớn, giống như là trong nháy mắt gặp sóng thần, căn bản không tại cùng một cái cấp bậc."),t("br"),t("br"),n._v("Lộc cộc lộc cộc lộc cộc lộc cộc!"),t("br"),t("br"),n._v("Hơi đỏ mặt, Ngô Hư bàn chân đạp trên mặt đất, liên tục lui về sau bảy, tám bước, trên đầu mồ hôi lạnh ứa ra, trong mắt tràn đầy khó tin vẻ."),t("br"),t("br"),n._v("“Chỉ bằng vào chân khí cùng thân thể lực lượng, thế mà sánh vai một cấp bậc Ngô Hư đều mạnh hơn lớn... Cái tên này tu luyện thế nào?”"),t("br"),t("br"),n._v("Một bên Trác Thanh Phong mấy người cũng con mắt trợn tròn, giật nảy mình."),t("br"),t("br"),n._v("Cùng cấp bậc Chiến sư, bất kể thân thể vẫn là chân khí, đều là đứng đầu nhất... Cái này mười sáu mười bảy tuổi thiếu niên, thế mà vượt qua cấp bậc, đều có thể đem Ngô Hư đẩy lui... Có phần quá kinh khủng chút."),t("br"),t("br"),n._v("“Tiếp tục đi!”"),t("br"),t("br"),n._v("Đem Ngô Hư đánh lui, Trịnh Dương trong lòng khí phách sinh ra, hét dài một tiếng, lần nữa bước ra."),t("br"),t("br"),n._v("Cùng thời khắc đó, trường thương liên tục nhẹ chút, mỗi một kích đều đem chung quanh Ngô Hư có thể phòng ngự lui về phía sau phương vị bao vây."),t("br"),t("br"),n._v("“Thật nhanh thương pháp, thật là cao thâm kỹ xảo chiến đấu...”"),t("br"),t("br"),n._v("Trác Thanh Phong lần nữa con ngươi thu hẹp."),t("br"),t("br"),n._v("Nếu như đối phương chỉ là dùng man lực, ngã không có gì có thể sợ hãi, dù sao lực lượng lớn, cũng không phải là chiến đấu chiến thắng chuẩn tắc, thật giống như ban ngày tỷ thí, Hồng Viễn học viện những học sinh kia, không có một cái lực lượng mạnh, có thể bản thân Chiến sư nhưng cũng không là đối thủ."),t("br"),t("br"),n._v("Man lực lớn, có thể dùng kỹ xảo chiến đấu bù đắp, tìm ra đối phương nhược điểm, đem hắn đánh bại..."),t("br"),t("br"),n._v("Vốn cho rằng Ngô Hư sẽ có cơ hội, nằm mơ đều không nghĩ tới, đối phương đối với chiến đấu lý giải, đối chiêu đếm được khống chế, đồng dạng mạnh mẽ."),t("br"),t("br"),n._v("Cái này đâm ra một thương, rõ ràng là nhìn ra Ngô Hư chiêu số bên trên lỗ thủng, dùng tốc độ nhanh nhất, đem chung quanh bao vây, như vậy trải qua, cho dù có mạnh hơn võ kỹ, đều không thi triển ra được."),t("br"),t("br"),n._v("Lực lượng mạnh, võ kỹ lĩnh ngộ sâu... Cái tên này từ đâu xuất hiện?"),t("br"),t("br"),n._v("Thật là đáng sợ!"),t("br"),t("br"),n._v("Bành bành bành bành!"),t("br"),t("br"),n._v("Trong lòng đang miên man suy nghĩ, phía trước Ngô Hư, đã hiểm tượng hoàn sinh, liên tục lui về phía sau mấy bước, lại cũng không chịu nổi, trường kiếm lập tức tuột tay, trên không trung tăng lăn lộn mấy vòng, cắm ở mười mấy mét bên ngoài trên mặt đất."),t("br"),t("br"),n._v("Mà hắn một cái lảo đảo té ngã trên đất, thiếu niên đối diện trường thương, đáp lên trên cổ, lạnh lẽo thấu xương, tựa như lúc nào cũng sẽ thiêu phá cổ họng."),t("br"),t("br"),n._v("“Ta thua...”"),t("br"),t("br"),n._v("Ngô Hư toàn thân cứng ngắc."),t("br"),t("br"),n._v("Vốn cho rằng đột phá Bán Thánh, cùng cấp bậc có thể đủ thắng quá hắn rất ít, nằm mơ đều không nghĩ tới, bị một cái chỉ có Tằm Phong cảnh sơ kỳ thiếu niên, nhẹ nhõm đánh bại, liền phản kháng lực lượng đều không có!"),t("br"),t("br"),n._v("“Lợi hại... Ta và ngươi tỷ thí!”"),t("br"),t("br"),n._v("Chuyển biến tốt bạn thua, triệt để như vậy, Lộc Thành cũng nhịn không được nữa, tiến về phía trước một bước."),t("br"),t("br"),n._v("“Lộc Thành, ngươi không phải là đối thủ!”"),t("br"),t("br"),n._v("Trác Thanh Phong lắc đầu."),t("br"),t("br"),n._v("Lấy nhãn lực của hắn, có thể nhẹ nhõm nhìn ra thiếu niên này đáng sợ."),t("br"),t("br"),n._v("Chân khí, lực lượng, tốc độ, đối võ kỹ lý giải, đối với chiến đấu lĩnh ngộ... Đều không có kẽ hở, không có một chỗ thiếu hụt."),t("br"),t("br"),n._v("Lộc Thành mặc dù rất sớm đã đột phá Bán Thánh, là hắn mang trong nhóm người này, thực lực mạnh nhất, có thể cùng đối phương so, vẫn là kém một đoạn dài, hoàn toàn không thể so sánh."),t("br"),t("br"),n._v("“Đội trưởng...” Lộc Thành tràn đầy cuống cuồng."),t("br"),t("br"),n._v("Đối phương đều đánh tới cửa nhà, đem bọn hắn Chiến sư mặt mũi, quét không còn một mảnh, không giáo huấn một lần, về sau còn như thế nào gặp người?"),t("br"),n._v(" “Vẫn là ta tự mình tới đi...”"),t("br"),t("br"),n._v("Lắc đầu, Trác Thanh Phong tiến về phía trước một bước, nhìn về phía cách đó không xa Trịnh Dương."),t("br"),t("br"),n._v("“Ta cũng không bắt nạt ngươi, ta sẽ đem tu vi áp chế cùng ngươi tương đồng!”"),t("br"),t("br"),n._v("Phần phật!"),t("br"),t("br"),n._v("Nói xong, Trác Thanh Phong khí tức trong người, liên tiếp thu hẹp, theo trước đó Thánh vực nhị trọng, biến thành Tằm Phong cảnh sơ kỳ."),t("br"),t("br"),n._v("Mặc dù tu vi đè thấp, nhưng hắn đối võ kỹ lý giải, cùng kinh nghiệm chiến đấu, tốc độ phản ứng, là không thay đổi, có thể nói, liền xem như Tằm Phong cảnh sơ kỳ, chân chính sức chiến đấu, so Bán Thánh kỳ Lộc Thành đều còn đáng sợ hơn."),t("br"),t("br"),n._v("“Bắt đầu đi!”"),t("br"),t("br"),n._v("Trịnh Dương nhẹ gật đầu, cũng không nói nhảm, trường thương trong tay giơ lên, trong nháy mắt, cả người phảng phất là một cây trường thương, thương cũng là hắn bản nhân."),t("br"),t("br"),n._v("Nhân thương hợp nhất cao thâm nhất cảnh giới —— người thương như một!"),t("br"),t("br"),n._v("Trác Thanh Phong vẻ mặt nghiêm túc, lấy ra một thanh trường kiếm, chĩa sang."),t("br"),t("br"),n._v("Vù vù!"),t("br"),t("br"),n._v("Biết đối phương lợi hại, thân ảnh nhoáng một cái, khi động thủ trước."),t("br"),t("br"),n._v("Bước chân của hắn, hết sức phức tạp, thoạt nhìn giống như giẫm lên một ít đặc thù bộ pháp, rõ ràng đi tới trước mặt, nhưng thật muốn công kích, sẽ phát hiện, khoảng cách rất xa, căn bản công kích không đến."),t("br"),t("br"),n._v("“Là một loại trận pháp... Trác Chiến sư, là đem bộ pháp cùng trận pháp dung hợp lại cùng nhau, tiến lên quá trình, cũng là bày trận quá trình!”"),t("br"),t("br"),n._v("Ô Thiên Khung con ngươi co rụt lại."),t("br"),t("br"),n._v("Mặc dù Chiến sư, không lĩnh ngộ phụ tu, nhưng lại có thể đem rất nhiều phụ tu dùng cho chiến đấu, tăng lên lực chiến đấu mạnh hơn."),t("br"),t("br"),n._v("Thật giống như Trác Thanh Phong hiện đang thi triển chiêu này."),t("br"),t("br"),n._v("Đem bộ pháp cùng trận pháp hữu hiệu kết hợp, sẽ để cho đối thủ tìm không rõ phương hướng của mình, từ đó không cách nào phán đoán, chuẩn xác nhất công kích địa điểm."),t("br"),t("br"),n._v("“Chiêu này rất đáng sợ, liền xem như ta, đều không thể ứng đối, chỉ có thể tạm thời trốn, xem thiếu niên này, đánh như thế nào đi...”"),t("br"),t("br"),n._v("Thẩm Bình Triều nhẹ gật đầu."),t("br"),t("br"),n._v("Trác Chiến sư dùng chiêu này, kỳ lạ không hiểu, hắn không áp chế tu vi, đều khó mà đoán, đối phương một cái Tằm Phong cảnh một khi ứng đối không tốt, liền sẽ tại chỗ suy yếu."),t("br"),t("br"),n._v("“A!”"),t("br"),t("br"),n._v("Đối diện Trịnh Dương, dường như nhìn ra mục đích của hắn, nhẹ nhàng hừ một cái, cũng không tránh né, trường thương trong tay, bỗng nhiên hướng mặt đất đâm tới."),t("br"),t("br"),n._v("Soạt!"),t("br"),t("br"),n._v("Một đạo thương mang, huy hoàng mà ra, mặt đất lập tức vạch ra một đạo khe nứt to lớn, đủ có vài chục mét dài ngắn."),t("br"),t("br"),n._v("Ngay tại lúc đó, trên thân thương chọn, đá vụn lăn mình, khói bụi tung bay."),t("br"),t("br"),n._v("“Lấy... Đá vụn phá trận pháp? Lợi hại!”"),t("br"),t("br"),n._v("Thấy cảnh này, Ô Thiên Khung ánh mắt sáng lên."),t("br"),t("br"),n._v("Vừa rồi hắn còn đang suy nghĩ, đối phương biến đổi ứng đối ra sao, lập tức liền thấy chiêu này, trong lòng lập tức tràn đầy kích động."),t("br"),t("br"),n._v("Trác Thanh Phong dùng hai chân bố trí trận pháp, thân ảnh là khó mà đoán, không thể nhận ra cảm giác, so huyễn ảnh càng thêm đáng sợ, đối phương không công kích, nhưng trực tiếp đâm về mặt đất, khói bụi phân tán bốn phía bay lên... Chẳng khác nào dùng khói trần bao phủ bốn phía."),t("br"),t("br"),n._v("Quản ngươi trận pháp gì, cái gì cước pháp, chỉ cần khói bụi có thể rơi lên trên đi, chính là thực thể, rơi không đi lên, chính là giả!"),t("br"),t("br"),n._v("Nói cách khác, một chiêu liền đem chân của hắn pháp phá."),t("br"),t("br"),n._v("Phần phật!"),t("br"),t("br"),n._v("Cảm khái âm thanh bên trong, thiếu niên đã phát hiện Trác Chiến sư vị trí cụ thể, trường thương đâm rách không khí, trực tiếp đi tới trước mặt."),t("br"),t("br"),n._v("“A!”"),t("br"),t("br"),n._v("Nhìn thấy đối phương nhanh như vậy liền phá giải chân của hắn pháp, Trác Thanh Phong khuôn mặt trầm xuống, trường kiếm trong tay nâng lên, hướng về phía trước đâm tới."),t("br"),t("br"),n._v("Đinh đinh đinh!"),t("br"),t("br"),n._v("Kiếm mang cùng mũi thương đối đụng nhau."),t("br"),t("br"),n._v("Ngực một im lìm, liên tục lui về phía sau mấy bước, Trác Thanh Phong trong lòng hoảng sợ."),t("br"),t("br"),n._v("Đồng dạng cấp bậc bên dưới, chân khí của hắn lực lượng thế mà kém xa tít tắp đối phương."),t("br"),t("br"),n._v("Nhất là chân khí độ tinh thuần, quả thực có trời vực chi chênh lệch, không thể so sánh nổi."),t("br"),t("br"),n._v("Có thể đem một cái mười, sáu bảy tuổi thiếu niên, dạy đến cường đại như thế, lão sư lại cái kia có bao nhiêu lợi hại?"),t("br"),t("br"),n._v("Ào ào ào!"),t("br"),t("br"),n._v("Liên tục vung mấy lần trường kiếm, lúc này mới đem đối phương công kích lực lượng tháo bỏ xuống, lần nữa vừa vặn xông lên, có điều, đối phương dường như nhìn ra hắn công kích thiếu hụt, trường thương không lưu tình chút nào, một thương nhanh hơn một thương."),t("br"),t("br"),n._v("Liên tục tám thương qua đi, Trác Thanh Phong khuôn mặt trắng bệch, đã có chút hô hấp không thoải mái."),t("br"),t("br"),n._v("Đối phương chân khí quá mức mạnh mẽ, ép tới hắn, căn bản là không có cách chống lại."),t("br"),t("br"),n._v("Nếu không phải bản thân hắn tu vi sớm đã đạt đến Thánh vực nhị trọng, tốc độ phản ứng nhanh, thân thể cũng càng thêm linh mẫn, chỉ sợ hiện tại đã bị trọng thương."),t("br"),t("br"),n._v("“Ngừng, không cần tiếp tục đánh rơi xuống... Ta không phải là đối thủ!”"),t("br"),t("br"),n._v("Về phía sau nhảy một bước, Trác Thanh Phong rời khỏi vòng chiến, đối lấy thiếu niên ở trước mắt khoát tay áo."),t("br"),t("br"),n._v("Mặc dù không muốn thừa nhận, nhưng mà sự thật chính là sự thật, liền xem như hắn tự mình ra tay, cũng không phải người thiếu niên trước mắt này đối thủ."),t("br"),t("br"),n._v("Đối phương bất kể là đối võ kỹ lý giải, vẫn là trên chiến đấu kinh nghiệm, thậm chí lực lượng, đều cao hơn hắn không chỉ một lần."),t("br"),t("br"),n._v("Loại này cường giả, một khi đi vào Chiến sư đường, ít nhất cũng là thiên phu trưởng, thậm chí... Phó thống lĩnh!"),t("br"),t("br"),n._v("Không nghĩ tới, ở đây còn có thiên tài như thế!"),t("br"),t("br"),n._v("“Ngươi cũng là Hồng Viễn học viện học sinh? Không biết lão sư là ai, có hứng thú hay không gia nhập chúng ta Chiến sư đường?”"),t("br"),t("br"),n._v("Thực sự nhịn không được, Trác Thanh Phong nói."),t("br"),t("br"),n._v("“Ta không phải Hồng Viễn học viện học sinh...”"),t("br"),t("br"),n._v("Đem trường thương thu hồi, Trịnh Dương hai tay chắp sau lưng, nhàn nhạt nhìn qua: “Bất quá, gia sư, Trương Huyền!”"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-948"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-950"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=c.exports}}]);